inline double predict(const std::vector<double>& features) {
    double sum = BASE_SCORE;
    for (int t = 0; t < N_TREES; ++t) {
        int node = 0;
        while (TREES[t][node].feature >= 0) {
            if (features[TREES[t][node].feature] < TREES[t][node].threshold) {
                node = TREES[t][node].left;
            } else {
                node = TREES[t][node].right;
            }
        }
        sum += TREES[t][node].value;
    }
    return sum;
}

